import React from "react";
import styled from "styled-components";
import "aos/dist/aos.css";
import Aos from "aos";
import { useEffect } from "react";

function Ninth() {
  return (
    <Container>
      <img src="/images/model-s/big-blue.jpg" alt="" />
      <Wrap1>
        <h1>405mi</h1>
        <p>Go anywhere with up to 405 miles of</p>
        <p>estimated range on a single charge</p>
      </Wrap1>
      <Wrap2>
        <h1>200mi</h1>
        <p>Supercharge up to 200 miles in</p>
        <p>15 minutes</p>
      </Wrap2>
      <Wrap3>
        <h1>25,000+</h1>
        <p>Superchargers placed along popular</p>
        <p>routes</p>
      </Wrap3>
    </Container>
  );
}

const Container = styled.div`
  height: 100vh;
  background: rgb(249, 249, 249);
  img {
    width: 70%;
    height: 100%;
  }
`;
const Wrap1 = styled.div`
  border: 1px solid black;
  h1 {
    color: rgb(249, 249, 249);
    transform: translate(130px, -115px);
    font-family: "Open Sans", sans-serif;
    font-weight: 500;
  }
  p {
    color: rgb(249, 249, 249);
    transform: translate(100px, -110px);
    font-size: 13px;
  }
`;

const Wrap2 = styled.div`
  border: 1px solid black;
  h1 {
    color: rgb(249, 249, 249);
    transform: translate(420px, -105px);
    font-family: "Open Sans", sans-serif;
    font-weight: 500;
  }
  p {
    color: rgb(249, 249, 249);
    transform: translate(390px, -100px);
    font-size: 13px;
  }
`;
const Wrap3 = styled.div`
  border: 1px solid black;
  h1 {
    color: rgb(249, 249, 249);
    transform: translate(670px, -115px);
    font-family: "Open Sans", sans-serif;
    font-weight: 500;
  }
  p {
    color: rgb(249, 249, 249);
    transform: translate(625px, -110px);
    font-size: 13px;
  }
`;

export default Ninth;
